package data

// Wall of text disclaimer about why names are difficult below - Read at your own
// peril.

// Names are a little tricky - to make a meaningful combination of family and given
// names, you need to take culture into account - some cultures do family-given,
// others do given-family, some have more complicated naming conventions etc.

// Additionally, sometimes you might want a name as it's spelled in a specific langauge,
// with that languages characterset, and other times you might want it spelled in your
// in a "romanized" characterset.

// Further, if you intend to have generate a list of names that would traditionally
// be associated with a given gender, you need to account for names that could
// belong to both (reasonably - clearly, every name could belong to any gender, but
// in the case where you want a name that sounds natively like one that would be assigned
// to a person of a certain gender in that languages culture for the sake of displaying
// "realistic" results... it's not so simple).

// Initially, I set out to capture all these complexities, but realized I could get
// a "good enough" set of base tools in place where people could mostly model the needed
// parts in Moldovas templating language alone. So, here is currently what is supported:

// There is a collection of First and Last names, which contain a map[string]string
// of languags to spellings of that name in that language. Where possible, unicode
// character names are supported/favored over non unicode. Each name has a "Default"
// that should be used when the chosen language is not present in the map. In this way,
// A best-effort attempt can be made to support any language, but falling back to
// a good-enough representation where ncessary.

// If you would like to see a new set of names added, please open a PR
// and provide some reference to where these names can be found for that language.

