// Name represents a name, Family or Given, that has both a traditional and a romanized
// version of the text, depending on the needs of the user
type Name struct {
	defaultLanguage string
	spellings       map[string]string
}

type spellings map[string]string

// GetSpelling will return the first match found for the provided list of languages, in the
// order in which they were passed in
func (n *Name) GetSpelling(languages ...string) string {
	for _, l := range languages {
		if name, ok := n.spellings[l]; ok && name != "" {
			return name
		}
	}
	return n.spellings[n.defaultLanguage]
}

